-- ----------------------------
-- Function structure for FN_GET_CATE_TITLE_BY_ID
-- ----------------------------
DROP FUNCTION IF EXISTS `FN_GET_CATE_TITLE_BY_ID`;
delimiter ;;
CREATE FUNCTION `FN_GET_CATE_TITLE_BY_ID`(`IN_ITEM_ID` varchar(36))
 RETURNS varchar(255) CHARSET utf8
  NO SQL 
BEGIN
	DECLARE result VARCHAR(255);
	SELECT title INTO result FROM t_category WHERE categoryId = IN_ITEM_ID;
	RETURN result;
END
;;
delimiter ;

